        RotatePoint(point){ // Rotates a point (3-element array) and returns the end result

            let pointX, pointY, pointZ, tempPointX, tempPointY, tempPointZ, tempPointX2, tempPointY2, tempPointZ2;

            tempPointX = point[0];
            tempPointY = point[1];
            tempPointZ = point[2];

            tempPointX2 = tempPointX;
            tempPointY2 = tempPointY * cos(this.angleX) - tempPointZ * sin(this.angleX);
            tempPointZ2 = tempPointY * sin(this.angleX) + tempPointZ * cos(this.angleX);
            pointX = tempPointX2 * cos(this.angleY) + tempPointZ2 * sin(this.angleY);
            pointY = tempPointY2;
            pointZ = tempPointX2 * -sin(this.angleY) + tempPointZ2 * cos(this.angleY);

            return [pointX, pointY, pointZ];
        }
        PointToScreen(point){ // 3D point to 2D screen coordinates

            return [122 + point[0] * 80 / (point[2] + 4) * disp.xStretch * this.scale, 40 - point[1] * 80 / (point[2] + 4) * this.scale];
        }
        Draw(){

            this.angleX = sin(disp.frameCount / 150) * 3;
            this.angleY = cos(disp.frameCount / 187) * 10;

            let rotatedVertices = [];
            let triPoints = [];
            let triShade = [];
            let triOrder = [];

            let point1, point2, point3, normalX, normalY, normalZ, pointID;
            for (let i = 0; i < this.objVertices.length; i++){ // We first calculate the 3D position of all the points,

                rotatedVertices.push(this.RotatePoint(this.objVertices[i]));
            }

            let triCount = 0;
            for (let i = 0; i < this.objTris.length; i++){

                point1 = this.PointToScreen(rotatedVertices[this.objTris[i][0]]);
                point2 = this.PointToScreen(rotatedVertices[this.objTris[i][1]]);
                point3 = this.PointToScreen(rotatedVertices[this.objTris[i][2]]);

                // Then check which triangles can be seen (back-face-culling),
                if (point1[0] * point2[1] - point1[1] * point2[0] + point2[0] * point3[1] - point2[1] * point3[0] + point3[0] * point1[1] - point3[1] * point1[0] > 0){ // Back face culling

                    triPoints.push([point1, point2, point3]);

                    point1 = rotatedVertices[this.objTris[i][0]];
                    point2 = rotatedVertices[this.objTris[i][1]];
                    point3 = rotatedVertices[this.objTris[i][2]];

                    triOrder.push([(point1[2] + point2[2] + point3[2]) / 3, triCount]);

                    // Shade them,
                    normalX = (point2[1] - point1[1]) * (point3[2] - point1[2]) - (point3[1] - point1[1]) * (point2[2] - point1[2]);
                    normalY = (point2[2] - point1[2]) * (point3[0] - point1[0]) - (point3[2] - point1[2]) * (point2[0] - point1[0]);
                    normalZ = (point2[0] - point1[0]) * (point3[1] - point1[1]) - (point3[0] - point1[0]) * (point2[1] - point1[1]);

                    triShade.push(int(min(max((normalX * -1 + normalY * 1 + normalZ * -1) * 10 + .5, 0), 1) * 8));

                    triCount++;
                }
            }
            // Sort them from back to front,
            for (let i = 1; i < triOrder.length; i++){

                let el = triOrder[i];
                let j = i - 1;
                while (j >= 0 && el[0] > triOrder[j][0]){

                    triOrder[j + 1] = triOrder[j];
                    j--;
                }
                triOrder[j + 1] = el
            }
            // And render them.
            for (let i = 0; i < triOrder.length; i++){

                pointID = triOrder[i][1];
                disp.FillTri(triPoints[pointID][0][0], triPoints[pointID][0][1], triPoints[pointID][1][0], triPoints[pointID][1][1], triPoints[pointID][2][0], triPoints[pointID][2][1], triShade[pointID])
            }
        }
